# -*- coding: utf-8 -*-

import random


def random_section(random_length, length):
    """Create list containing random byte values followed by zeros.
    
    Args:
      random_length: Number of random values. Has to be less than
          or equal length.
      length: Overall length of the requested list.
    
    Returns:
      List containing random values followed by zeros.
    """
    data = []
    random.seed()
    for _ in xrange(random_length):
        data.append(random.randint(0, 0xff))
    
    # fill with zeros to get overall length
    data.extend([0]*(length-random_length))
    return data


def format_bytes(data, line_prefix="", numbers_per_line=16):
    """Create string from the data regarding a certain format.
    
    A line of the created string consists of the prefix, a certain amount of 
    data entries in hex separated by commas, a hash sign and the offset of
    the first data entry on the line in hex.
    
    Args:
      data: Sequence of byte values.
      line_prefix: Prefix that is put in front of ever line in the string.
          Default is ''.
      numbers_per_line: Number of data entries per line.
          Default is 16.
    
    Returns:
      String containing the data set.
    """
    parts = []
    
    # full lines
    for i in xrange(len(data)/numbers_per_line):
        parts.append(line_prefix)
        for j in xrange(numbers_per_line):
            parts.append("0x%.2X" % data[i*numbers_per_line+j])
            parts.append(", ")
        parts.append("# 0x%.4X\n" % (i*numbers_per_line))
    
    # partial line
    if (len(data)%numbers_per_line) != 0:
        parts.append(line_prefix)
        for j in xrange(-(len(data)%numbers_per_line), 0):
            parts.append("0x%.2X" % data[j])
            parts.append(", ")
        parts[-1] = " # 0x%.4X\n" % (len(data)-len(data)%numbers_per_line)
    
    return "".join(parts)


def create_firmware_string(section_count):
    """Create random data for firmware as python code.
    
    All data is represented as bytearray.
    The data consists of a header, a footer and a list called sections
    containing the base section and the specified number of addtional sections.
    
    Args:
      section_count: Number of section to be created (additional to the base)
    
    Returns:
      String containing the random data as python code.
    """
    parts = []
    prefix = "\t"
    
    # header
    parts.append("header = bytearray([\n")
    parts.append(format_bytes(random_section(0x112, 0x200), prefix))
    parts.append("])\n\n")
    
    # base
    prefix = "\t\t"
    parts.append("sections = [\n")
    parts.append("\t# base\n")
    parts.append("\tbytearray([\n")
    parts.append(format_bytes(random_section(0x3325, 0x6000), prefix))
    parts.append("\t]),\n")
    
    # other sections
    for i in xrange(section_count):
        parts.append("\t# section %X\n" % i)
        parts.append("\tbytearray([\n")
        parts.append(format_bytes(random_section(random.randint(0x1000, 0x4000),
            0x4000), prefix))
        parts.append("\t]),\n")
        
    parts.append("]\n\n")
    
    # footer
    prefix = "\t"
    parts.append("footer = [\n")
    parts.append(format_bytes(random_section(0x85, 0x200), prefix))
    parts.append("]\n\n")
    
    return "".join(parts)

